import React, { Component } from 'react';
import {connect} from 'react-redux';
import './dashboard.css';
import * as actions from '../../actions/dashboard';
import Sidebar from '../sidebar/sidebar';

class Dashboard extends Component {

	constructor(props){
		super(props) ;

		this.state = {
            user_id: "125",

		}
	}

    componentDidMount() {
        console.log('Component DID MOUNT!');
        this.props.getDashboardcourses(this.state.user_id);

     }

     componentWillReceiveProps(newProps) {
        console.log('Will Receive Props ' , newProps)


    }

    render() {
        return (
            	<div>
			        <Sidebar/>
                </div>
        );
    }
}


function mapStateToProps(state) {

    return {
        user_id: state.dashboard.user_id,
        course_list: state.dashboard.course_list
    };
}

function mapDispatchToProps(dispatch) {

    return {
        getDashboardcourses : (user_id) => dispatch(actions.getDashboardcourses(user_id))
    };
}

export default connect(mapStateToProps,mapDispatchToProps)(Dashboard);
